import styles from "./Footer.module.scss";

export default () => (
  <footer className={styles.Footer}>
    <div className={styles.Footer__logoWrapper}>
      {/* <img className={styles.Footer__image} src="/the-fine-web.png" alt="" /> */}
      <div
      // className={
      //   this.state.hasScrolled
      //     ? "site-header__brand-name"
      //     : "site-header__brand-name-init"
      // }
      >
        <div className="site-header__brand-wrapper__line"></div>
        <div className="site-header__brand-name__the">The</div>
        <div className="site-header__brand-name__fine-web">Fine Web</div>
        {/* <img src="/the-fine-web.png" alt="" /> */}
      </div>
    </div>

    <div className={styles.Footer__inner}>
      <p className={styles.Footer__copyright}>&copy;2020 The Fine Web</p>
      <div className={styles.Footer__social}>
        <a
          href="https://twitter.com/GreggFine"
          target="_blank"
          className={styles.Footer__socialLink}
        >
          <i className="fa fa-twitter"></i>
        </a>
        <a
          href="https://www.youtube.com/channel/UCmOpHGj4JRWCdXhllVTZCVw/videos"
          target="_blank"
          className={styles.Footer__socialLink}
        >
          <i className="fa fa-youtube"></i>
        </a>
        <a
          href="https://www.instagram.com/greggfinedev/"
          target="_blank"
          className={styles.Footer__socialLink}
        >
          <i className="fa fa-instagram"></i>
        </a>
      </div>
    </div>
  </footer>
);
